import React from 'react';
import './NewsCard.css';

function NewsCard() {
    return (
        <section className="news__container">
            <h3 className="news__title">Результаты поиска</h3>

            <button className="news__btn-add">Показать ещё</button>
        </section>
    )
}

export default NewsCard;
